import React, { Component } from "react";

class SelectButton extends Component {
	state = {};
	render() {
		return (
			<React.Fragment>
				<li>
					<div className="collapsible-header">Order</div>
					<div className="collapsible-body"></div>
				</li>
			</React.Fragment>
		);
	}
}

export default SelectButton;
